import React from "react";
import "./styles.css"; // Import the styling

function App() {
  const handleSubmit = (e) => {
    e.preventDefault();

    const form = e.target;
    const email = form.elements.email.value;

    if (!email) {
      alert("Please provide an email.");
      return;
    }

    alert("Form submitted successfully!");
  };

  return (
    <div className="app-container">
      <header className="header">
        <h1>Calvin's Dog Walking & Training Services</h1>
        <p>Professional care for your furry friends!</p>
      </header>

      <section className="about-section">
        <h2>About Us</h2>
        <p>
          At Calvin's Dog Walking & Training, we provide exceptional services to keep your pets happy, healthy, and well-trained. With years of experience, we ensure your dogs are in loving and capable hands.
        </p>
        <div className="image-gallery">
          <img src="/dog-walking.jpg" alt="Dog Walking" className="gallery-image" />
          <img src="/dog-training.jpg" alt="Dog Training" className="gallery-image" />
          {/* <img src="/happy-dog.jpg" alt="Happy Dog" className="gallery-image" /> */}
        </div>
      </section>

      <section className="pricing-section">
        <h2>Pricing</h2>
        <ul>
          <li>$50 - 1 Hour Walk</li>
          <li>$100 - 1 Hour Walk + 30 Minutes Training</li>
          <li>$60 - 30 Minutes Training</li>
          <li>$100 - 1 Hour Training</li>
        </ul>
      </section>

      <section className="contact-section">
        <h2>Contact Us</h2>
        <form action="https://formspree.io/f/meoowqdb" method="POST" onSubmit={handleSubmit}>
          <input type="text" name="name" placeholder="Your Name" required />
          <input type="email" name="email" placeholder="Your Email" required />
          <textarea name="message" placeholder="Your Message" required></textarea>
          <button type="submit">Send</button>
        </form>
      </section>

      <footer className="footer">
        <p>&copy; 2025 Calvin's Dog Walking & Training Services</p>
      </footer>
    </div>
  );
}

export default App;
